import React, {Fragment} from 'react';
import axios from '../node_modules/axios';

const Home = () => {
  handleSubmit = e => {
    e.preventDefault();
    alert('TEST');
  };

  return (
    <Fragment>
      <div className='wrapper'>
        <div className='vert-line' />
        <form id='stock-form' onSubmit={this.handleSubmit}>
          <h1>Cash - $5000.00</h1>
          <input type='text' className='stock-control' placeholder='Ticker' />
          <input type='text' className='stock-control' placeholder='Qty' />
          <input type='submit' className='stock-control-submit' value='Buy' />
        </form>
      </div>
    </Fragment>
  );
};

export default Home;
